import { version } from "react"

const videos = [
    {
        "id": 1,
        "name": 'Название',
        "duration": 10 
    },
    {
        "id": 2,
        "name": 'Другое название',
        "duration": 15 
    }
]

export function VideoList() {
    return(
        <>
            <h1>Video list</h1>
            {
                videos.map((video) => {
                    return (
                        <div key={video.id}>
                            <p>{video.name}</p>
                            <p>{video.duration}</p>
                            <button>Лайк</button>
                        </div>
                    )
                })
            }
        </>
    )
}
